import DashTable from './DashTable'
import axios from 'axios'

const RoleSelect = (props) => {

    const [candidateData, setCandidateData] = useState([])

    useEffect(()=>{
        axios.get('https://dct-application-form.herokuapp.com/users/application-forms')
        .then((response)=>{
            const result = response.data
            setCandidateData(result)
        })
        .catch((err)=>{
            console.log(err.message)
        })
    }, [])

    return (
        <div>
            <button onClick={handleAll}>All</button>
            <button onClick={handleFeDev}>Front-End Developer</button>
            <button onClick={handleNode}>Node.js Developer</button>
            <button onClick={handleAll}>MEAN Stack Developer</button>
            <button onClick={handleAll}>FULL Stack Developer</button>
            <DashTable candidateData={candidateData}/>
        </div>
    )
}

export default RoleSelect
